About the game:

StarCraft II: Wings of Liberty is a military science fiction real-time strategy video game currently under development by Blizzard Entertainment as a sequel to the award-winning 1998 video game StarCraft. 

Set in the 26th century in a distant part of the Milky Way galaxy, the game is built around three species: the Terrans, human exiles from Earth; the Zerg, a race of insectoids; and the Protoss, a species with vast psionic power. Wings of Liberty specifically focuses on the Terrans, while the expansions Heart of the Swarm and Legacy of the Void focus on the Zerg and Protoss, respectively. The game is set four years after the events of StarCraft: Brood War, and follows the exploits of Jim Raynor as he leads an insurgent group against the autocratic Terran Dominion.


